import {Link} from 'react-router-dom'
function Navbar() {
    return (
      <div className="Navbar">
       <nav>
          <ul>
            <li>
              <Link to="/about">About Me</Link>
            </li>
            <li>
              <Link to="/town">My Town</Link>
            </li>
          </ul>
        </nav>
      </div>
    );
  }

  export default Navbar;
